cy.api({
  method: "POST",
  url: url,
  body: {
    usuario: Cypress.env("user_nameBC"),
    senha: "123"
  },
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(404);
  expect(r.body).to.have.nested.property("message.Usuario._warning", "Usuário ou senha inválidos.");
});

cy.api({
  method: "POST",
  url: url,
  body: {
    usuario: "/",
    senha: Cypress.env("user_passwordBC")
  },
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(404);
  expect(r.body).to.have.nested.property("message.Usuario._warning", "Usuário não encontrado.");
});

cy.api({
  method: "POST",
  url: url,
  body: {
    usuario: "",
    senha: Cypress.env("user_passwordBC")
  },
  failOnStatusCode: false
}).then(r => {
  expect(r.status).to.eq(400);
  expect(r.body).to.have.nested.property("message.usuario._error", "Usuario precisam ser preenchido.");
});

